import React from 'react';
import './App.css';
import PersonalCard from '/components/PersonalCard'

function App() {
  return (
    <div className="App">
      <header className="App-header">
      <personalcard firstName="Doe"/>
      <personalcard lastName="Jane"/>
      <personalcard Age="45"/>
      <personalcard Hair Color="Black"/>
      </header>
    </div>
  );
}

export default App;
